  <div>
    <p id="txt1"><span>病灶检测</span></p>
  </div>
  <div id="u81">
    <p><span style="text-decoration:none">&nbsp;&nbsp; &nbsp;&nbsp; 该模块主要用于检测影像中的病灶，是提升诊断效率的前提。在此界面可以选择对应的图像分类模型以及对应的权重文件，可同时上传多张图片进行测试，同时输出各图片的预测结果、置信度以及图片集的识别率。</span></p>
  </div>
  <div>
    <p id="txt2"><span>病灶分割</span></p>
  </div>
  <div id="u82">
    <p><span style="text-decoration:none;">&nbsp;&nbsp; &nbsp; &nbsp; 在病灶检测基础上，对病灶进行精细化的分割，是病灶量化分析的基础。在此界面可以选择对应的图像分割模型以及对应的权重文件，可同时上传多张图片进行测试，同时输出各图片的掩膜图。</span></p>
  </div>
  <div>
    <p id="txt3"><span>疾病分型</span></p>
